import React from 'react';
import TodoItem from './TodoItem/TodoItem';

function TodoList({ tasks, deleteTask }) {
  return (
    <div>
      {tasks.map((task, index) => (
        <TodoItem
          key={index}
          task={task}
          index={index}
          deleteTask={deleteTask}
        />
      ))}
    </div>
  );
}

export default TodoList;
